import React from "react";

export default function Bio() {
  const bioStyle = {
    position: "absolute",
    top: "300px",
    maxWidth: "35%",
    maxHeight: "25%",
    background: "rgba(0,0,0,.3)",
  };

  return (
    <>
      <p style={bioStyle}>
        Hey there - I'm Alex I'm a full-stack developer with a passion for
        music, books, and oxford commas. Check out my projects above, or get in
        touch with me below ~
      </p>
    </>
  );
}
